webpackJsonp([0xfbd520158f0],{2482:function(t,e){t.exports={data:{markdownRemark:{html:'<p>A PC that I used for the first time. Although I had few opportunities to use it in common with my parents, I used only Ichitaro 5 (DOS version), so I did not care too much at that time.</p>\n<p>I started to understand the value of PC in the middle of 1994, around 1995-1996 I was a little tangled around, but then <a href="/pc-9821">I</a> improved <a href="/pc-9821">my PC without introducing my own personal computer</a> .</p>\n<p>As of 2003, although it was off the active machine, it is occasionally in operation at home.</p>\n<p>As of 2013, it seems that it is kept dynamic. However, it is unknown whether it moves or not.</p>\n<h2>Works / Other things I did</h2>\n<ul>\n<li>(Original game) <a href="/6338">Treasure of the destroyed castle Ⅰ</a></li>\n<li>(Original game) <a href="/tag/cats-story">CATS STORY</a> Production start (However, at the time Otsum was scarce and was torn down in one year)</li>\n<li>I guess afterwards it\'s really a one-story story</li>\n</ul>\n<h2>Performance</h2>\n<ul>\n<li>CPU: intel 486 SX (20 MHz)</li>\n<li>RAM: 5.6MB</li>\n<li>VGA: EGC</li>\n<li>VRAM: 256 KB</li>\n<li>HDD: 40 MB (SASI) + 176 MB (SCSI)</li>\n<li>DRIVE: 5 inch 2 HD FDD × 2 + 3.5 inch 2 HD FDD × 1</li>\n<li>NET: 14.4 kbps Modem</li>\n<li>SOUND: BEEP</li>\n<li>OS: MS-DOS 3.3C</li>\n</ul>',frontmatter:{cover:null,date:"1992-05-01T00:00:00+09:00",strDate:"1992/4/30",title:"(1992-1996) NEC PC-H 98 S model 40"}}},pathContext:{path:"/en/blog/1992/05/01-pc-h98s/",langKey:"en"}}}});
